import React, { Component } from 'react';
import Notications from  "./notifcation"; 
import Projectlist from "../project/projectlist";
import { connnet } from 'react-redux';


class Dashboard extends Component {
    render(){
        console.log(this.props);
        return (
            <div className="dashboard container">
                <div className="row">
                    <div className="col s12  m6"> <Projectlist /> </div>
                    <div className="col s12 m5 offset-m1"> <Notications /> </div>
                </div>
            </div>
        );
    }
};;
const mapStateToProps = (state) =>{
    return(
        project: state.project.project  
    )
}


export default connnet(mapStateToProps)(Dashboard);
